    主要功能：
    - 发送 Radare2 命令并获取输出
    - 会话状态在调用之间保持（对于同一文件）
    - 支持使用 r2ghidra 插件进行反编译：
    * 使用 `pdg` 命令反编译函数
    * 提供类似 C 的伪代码输出


